別売りパネルと一緒に遊べる、パネルワールド用の車両です。遊びが更に広がります!!<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">別売りパネルと一緒に遊べる、パネルワールド用の車両です。遊びが更に広がります!!</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">列車:W80×H27×D40mm</font><br><font color="#333333" size="-1">個装サイズ：11×13×4cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：75g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">対象年齢:3才以上<br>使用電池:単4乾電池×1本(別売)<br>JR西日本商品化許諾申請済</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
